import React from 'react'
import Box from '@mui/material/Box';
import Card from '@mui/material/Card';

const StudentCard = ({student}) => {
    console.log(student)
    return (
        <div>
            <Card sx={{mb:"5px", minWidth: "300px"}}>
            <h1>{student.name}</h1>

            </Card>

        </div>
    )
}

export default StudentCard
